demo.repl.help:
Comandos disponibles:
  @show              ─ mostrar el resumen de la última tarjeta adaptativa
  @json              ─ emitir el JSON crudo recibido del flujo
  @back              ─ volver a la tarjeta/entradas bloqueadas anteriores
  @input <k>=<v>     ─ establecer o reemplazar un campo de entrada
  @click <action_id> ─ enviar la tarjeta con la acción indicada
  @help              ─ mostrar esta ayuda
  @quit              ─ salir del REPL
